import React from 'react';
import StatCard from './StatCard';
import FacilityList from './FacilityList';
import DoctorList from './DoctorList';
import ReactDOM from 'react-dom/client';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

const Dashboard = () => {
  const stats = [
    { icon: "https://cdn.builder.io/api/v1/image/assets/TEMP/645ebcc21dee42475ab18acf5406c5a943ffd9135e81088dfbc355e4a9fe9a87?placeholderIfAbsent=true&apiKey=8f0d2cc9bf764b679624a1d309a49f82", count: 15, label: "Doctors" },
    { icon: "https://cdn.builder.io/api/v1/image/assets/TEMP/bed9b7541659c2d430a307f8e5f21a44d44d0dc1d9446ba2a7cbd611df96bde3?placeholderIfAbsent=true&apiKey=8f0d2cc9bf764b679624a1d309a49f82", count: 139, label: "Appointments" },
    { icon: "https://cdn.builder.io/api/v1/image/assets/TEMP/fd4001b3ce059345da6e2573f27283b4252a81f91fb09ee7d168ab983a1c21a2?placeholderIfAbsent=true&apiKey=8f0d2cc9bf764b679624a1d309a49f82", count: 124, label: "Patients" }
  ];

  return (
    <main className="flex z-10 flex-col items-start self-center mt-5 ml-16 w-full max-w-[1428px] max-md:max-w-full">
      <section className="flex flex-wrap gap-3">
      </section>
      <img 
        src="https://cdn.builder.io/api/v1/image/assets/TEMP/67ab25dfbe84419bbec844be527f71efc68b5c6cc9d3cbba8d5699717b1e9e0a?placeholderIfAbsent=true&apiKey=8f0d2cc9bf764b679624a1d309a49f82" 
        alt="" 
        className="rotate-[3.141592653589793rad] w-14 mt-0 ml-4 max-md:ml-2.5" 
      />
      <nav className="flex gap-20 ml-24 mt-0 max-md:ml-2.5">
        <span className="text-base font-thin leading-6 text-black">Doctors</span>
        <span className="text-base font-thin leading-6 text-black">Facilities</span>
      </nav>
      <div className="flex gap-4 mt-4">
        <FacilityList />
        <DoctorList />
      </div>
    </main>
  );
};

export default Dashboard;
